import React, { Component } from 'react';

class User extends Component {
    render () {
        return(
            <div>
                <ul>
                    <li>Name = {this.props.Name}</li>
                    <li>Deparment = {this.props.Deparment}</li>
                    <li>Skill = {this.props.Skill}</li>
                </ul>
            </div>
        )
    }
}

export default User;
